import {Dispatch} from "redux";

const initialState = null
export const testReducer = (state=initialState,action) => {
    debugger
    switch (action.type) {
        case 'TEST': {
            return {
                ...state,
                prop: action.prop,
            }

        }

        default:
            return state
    }
}


export const testAC = (test) => ({type:'TEST',test});
